const divStyle = {
    display: 'flex',
    width: "50vw",
    height: "50vh",
    background: "green",
    alignItems: "center",
    justifyContent: "center",
    position: "absolute",
    zIndex: "999"
}

const Header = (props) => {
    return (
        <div>
            <h1>To Do App</h1>
            {props.timeToGetBusy ? <div style={divStyle}> asdasda</div> : null}
            <p>Add, Edit or Delete a Todo Item.</p>
        </div>
    )
}

export default Header;
